  [],\n\t\"revision_timestamp\": \"2016-07-27T22:23:41.860322\",\n\t\"name\": \"muscatatuck-national-wildlife-refuge-annual-narrative-report-fiscal-year-2006\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Muscatatuck
  National Wildlife Refuge outlines Refuge accomplishments during the 2006 fiscal
  year. The report begins with an introduction to the Refuge. Highlights and weather
  conditions are summarized for the year. Information about monitoring and studies-
  including surveys and censuses and studies and investigations- is provided next.
  Habitat restoration and management projects are also covered; activities include
  wetland restoration, upland restoration, riverine restoration, water level management,
  moist soil management, mowing, farming, timber management, prescribed burning, and
  vegetation control. Fish and wildlife management are discussed next with emphasis
  on bird banding, disease monitoring, reintroductions, nest structures, and animal
  control. Coordination activities, such as interagency coordination, tribal coordination,
  and private land activities, are outlined. The resource protection section provides
  an update on law enforcement, permits, contaminant investigation, water rights,
  and cultural resource management. Information about public education and recreation
  is given including visitor services and outreach. Finally, comprehensive management
  planning and general administration are discussed in the Refuge planning and administration
  section. Refuge brochures are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
